    //
    // `path` may contain multiple segments, separated by "/" characters,
    // and should never be empty; i.e., "" is an invalid path.
    //
    // `flags` may be any of the `OPEN_FLAG_*` and `OPEN_RIGHT_*` values, bitwise ORed together.
